import React from "react";
import { Grid, Stack, Typography } from "@mui/material";
import { Box, styled } from "@mui/system";
import LocationOnIcon from "@mui/icons-material/LocationOn";
import CallIcon from "@mui/icons-material/Call";
import MailIcon from "@mui/icons-material/Mail";
import FacebookIcon from "@mui/icons-material/Facebook";
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import CustomBox from "./CustomBox";

const MainTypography = styled(Typography)(({ theme }) => ({
  color: "white",
  fontWeight: 700,
  fontSize: { xs: 12, lg: 16 },
}));

const SubTypography = styled(Typography)(({ theme }) => ({
  color: "white",
  fontWeight: 500,
  fontSize: { xs: 8, lg: 14 },
}));

function Footer() {
  return (
    <>
      <Grid
        container
        spacing={0}
        sx={{ backgroundColor: "#2C2C2C", marginTop: 10, padding: 5 }}
      >
        <Grid item xs={12} lg={3} sx={{ marginBottom: { xs: 8, lg: 0 } }}>
          <MainTypography
            fontSize={{
              xs: 30,
              lg: 40,
            }}
          >
            BANTO
          </MainTypography>
        </Grid>
        <Grid item xs={12} lg={2} sx={{ marginBottom: { xs: 8, lg: 0 } }}>
          <Stack spacing={2}>
            <MainTypography>Information</MainTypography>
            <SubTypography>Main</SubTypography>
            <SubTypography>Gallery</SubTypography>
            <SubTypography>Projects</SubTypography>
            <SubTypography>Certifications</SubTypography>
            <SubTypography>Contacts</SubTypography>
          </Stack>
        </Grid>
        <Grid item xs={12} lg={4} sx={{ marginBottom: { xs: 8, lg: 0 } }}>
          <Stack spacing={{ xs: 2, lg: 4 }}>
            <MainTypography>Contacts</MainTypography>
            <Box sx={{ width: 200 }}>
              <LocationOnIcon />
              <SubTypography>
                서울특별시 서초구 서초동 1362 B-109호
              </SubTypography>
            </Box>
            <SubTypography>
              <CallIcon />
              070.7010.7200
            </SubTypography>
            <SubTypography>
              <MailIcon />
              jaylee@banto.io
            </SubTypography>
          </Stack>
        </Grid>
        <Grid item xs={12} lg={3}>
          <Stack spacing={2}>
            <MainTypography>Social Media</MainTypography>
            <Grid item>
              <FacebookIcon sx={{ color: "white" }} />
              <LinkedInIcon sx={{ color: "white" }} />
            </Grid>
          </Stack>
        </Grid>
      </Grid>

      <Grid
        container
        spacing={0}
        justifyContent="center"
        alignItems="center"
        sx={{
          backgroundColor: "#2C2C2C",
          padding: 5,
          borderTop: "1px solid #C8C8C8",
        }}
      >
        <CustomBox>
          <Typography sx={{ color: "##C8C8C8" }}>
            © 2021 All Rights Reserved
          </Typography>
        </CustomBox>
      </Grid>
    </>
  );
}

export default Footer;
